import Post from './components/Post';

function App() {

const example = ()=>{
  return (
    <div>
<h1>hello ivgeny</h1>
<button>click me</button>
<button>click him</button>
    </div>
  )
};

  let postA = [
    { title: "darkcyan", info: "John wick"},
    { titel: "blueviolet", info: "Tuna" },
    { titel: "salmon", info: "Eminem"},
  ];

return (
  <div className="App">
    {example()}
    <Header />
    <Middel />
    <Last />
    <Post titel={postA[0].titel} info={postA[0].info} />
    <Post titel={postA[1].titel} info={postA[1].info} />
    <Post titel={postA[2].titel} info={postA[2].info} />
{postA.map((value)=>{
return <Post titel={value.titel} info={value.info} />
})}
</div>
);
};

export default App;
